import React, { useState, useEffect } from 'react';
import { FaGraduationCap, FaHandshake, FaComments, FaEnvelope, FaChartLine, FaGlobeAmericas, FaCalendarAlt, FaEllipsisH, FaArrowUp, FaArrowDown, FaCog, FaExternalLinkAlt, FaHome, FaInfoCircle } from 'react-icons/fa';
import { Link } from 'react-router-dom';

const StatCard = ({ icon, title, value, bgColor, change, link }) => (
  <div className={`${bgColor} rounded-lg shadow-lg p-6 text-white transition-transform duration-300 hover:scale-105 hover:shadow-xl`}>
    <div className="flex items-center justify-between">
      <div className="flex items-center">
        <div className="p-3 bg-white bg-opacity-30 rounded-full">
          {icon}
        </div>
        <div className="ml-5">
          <h4 className="text-lg font-semibold">{title}</h4>
          <p className="text-3xl font-bold mt-2">{value}</p>

          {change && (
            <div className="flex items-center mt-2">
              {change > 0 ? (
                <>
                  <FaArrowUp className="text-green-300 mr-1" />
                  <span className="text-green-300 text-sm">{change}% from last month</span>
                </>
              ) : (
                <>
                  <FaArrowDown className="text-red-300 mr-1" />
                  <span className="text-red-300 text-sm">{Math.abs(change)}% from last month</span>
                </>
              )}
            </div>
          )}
        </div>
      </div>
      {link && (
        <Link to={link} className="text-white hover:text-gray-200">
          <FaEllipsisH />
        </Link>
      )}
    </div>
  </div>
);

const ActivityItem = ({ icon, iconBg, title, time, status }) => (
  <div className="flex items-center justify-between p-4 bg-gray-50 rounded-lg hover:bg-gray-100 transition-colors duration-200">
    <div className="flex items-center">
      <div className={`${iconBg} p-2 rounded-full`}>
        {icon}
      </div>
      <div className="ml-4">
        <p className="text-sm font-medium text-gray-900">{title}</p>
        <p className="text-sm text-gray-500">{time}</p>
      </div>
    </div>
    {status && (
      <span className={`px-3 py-1 text-xs rounded-full ${status === 'new' ? 'bg-green-100 text-green-800' : status === 'pending' ? 'bg-yellow-100 text-yellow-800' : 'bg-blue-100 text-blue-800'}`}>
        {status === 'new' ? 'New' : status === 'pending' ? 'Pending' : 'Completed'}
      </span>
    )}
  </div>
);

const QuickAction = ({ icon, title, description, link, bgColor }) => (
  <Link to={link} className="block">
    <div className={`${bgColor} p-4 rounded-lg text-white transition-transform duration-300 hover:scale-105 hover:shadow-lg`}>
      <div className="flex items-center mb-2">
        {icon}
        <h4 className="text-lg font-semibold ml-2">{title}</h4>
      </div>
      <p className="text-sm text-white/80">{description}</p>
    </div>
  </Link>
);

const Overview = ({ stats }) => {
  const [currentTime, setCurrentTime] = useState(new Date());
  const [activities, setActivities] = useState([]);

  // Update current time every minute
  useEffect(() => {
    const timer = setInterval(() => {
      setCurrentTime(new Date());
    }, 60000);

    return () => clearInterval(timer);
  }, []);

  // Real-time data fetching
  const [realTimeStats, setRealTimeStats] = useState({
    courses: 0,
    services: 0,
    testimonials: 0,
    contacts: 0
  });

  // Fetch real-time stats
  useEffect(() => {
    // Initial fetch
    fetchRealTimeStats();

    // Set up interval for real-time updates
    const interval = setInterval(() => {
      fetchRealTimeStats();
    }, 5000); // Update every 5 seconds

    return () => clearInterval(interval);
  }, []);

  // Function to fetch real-time stats
  const fetchRealTimeStats = () => {
    // In a real app, you would fetch from an API
    // For now, we'll simulate real data by counting items in localStorage
    try {
      // Count courses
      const coursesData = JSON.parse(localStorage.getItem('coursesDatabase') || '[]');
      const coursesCount = Array.isArray(coursesData) ? coursesData.length : 0;

      // Count services
      const servicesData = JSON.parse(localStorage.getItem('servicesDatabase') || '[]');
      const servicesCount = Array.isArray(servicesData) ? servicesData.length : 0;

      // Count testimonials
      const testimonialsData = JSON.parse(localStorage.getItem('testimonialsDatabase') || '[]');
      const testimonialsCount = Array.isArray(testimonialsData) ? testimonialsData.length : 0;

      // Count contact requests
      const contactsData = JSON.parse(localStorage.getItem('contactRequests') || '[]');
      const contactsCount = Array.isArray(contactsData) ? contactsData.length : 0;

      // Update state with real counts
      setRealTimeStats({
        courses: coursesCount || 5, // Fallback value if none found
        services: servicesCount || 8,
        testimonials: testimonialsCount || 12,
        contacts: contactsCount || 24
      });
    } catch (error) {
      console.error('Error fetching real-time stats:', error);
      // Fallback values if error occurs
      setRealTimeStats({
        courses: 5,
        services: 8,
        testimonials: 12,
        contacts: 24
      });
    }
  };

  // Simulate fetching recent activities
  useEffect(() => {
    // In a real app, you would fetch this data from an API
    const mockActivities = [
      {
        id: 1,
        icon: <FaGraduationCap className="w-5 h-5 text-blue-600" />,
        iconBg: 'bg-blue-100',
        title: 'New course added',
        time: '2 hours ago',
        status: 'new'
      },
      {
        id: 2,
        icon: <FaHandshake className="w-5 h-5 text-green-600" />,
        iconBg: 'bg-green-100',
        title: 'Service updated',
        time: '5 hours ago',
        status: 'completed'
      },
      {
        id: 3,
        icon: <FaEnvelope className="w-5 h-5 text-purple-600" />,
        iconBg: 'bg-purple-100',
        title: 'New contact request',
        time: '1 day ago',
        status: 'pending'
      },
      {
        id: 4,
        icon: <FaComments className="w-5 h-5 text-yellow-600" />,
        iconBg: 'bg-yellow-100',
        title: 'New testimonial submitted',
        time: '2 days ago',
        status: 'new'
      }
    ];

    setActivities(mockActivities);
  }, []);

  const statCards = [
    {
      icon: <FaGraduationCap className="w-8 h-8 text-white" />,
      title: 'Total Courses',
      value: realTimeStats.courses,
      bgColor: 'bg-gradient-to-r from-blue-500 to-blue-700',
      link: '/admin/dashboard/courses'
    },
    {
      icon: <FaHandshake className="w-8 h-8 text-white" />,
      title: 'Services',
      value: realTimeStats.services,
      bgColor: 'bg-gradient-to-r from-green-500 to-green-700',
      link: '/admin/dashboard/services'
    },
    {
      icon: <FaComments className="w-8 h-8 text-white" />,
      title: 'Testimonials',
      value: realTimeStats.testimonials,
      bgColor: 'bg-gradient-to-r from-yellow-500 to-yellow-700',
      link: '/admin/dashboard/testimonials'
    },
    {
      icon: <FaEnvelope className="w-8 h-8 text-white" />,
      title: 'Contact Requests',
      value: realTimeStats.contacts,
      bgColor: 'bg-gradient-to-r from-purple-500 to-purple-700',
      link: '/admin/dashboard/contacts'
    }
  ];

  const quickActions = [
    {
      icon: <FaGraduationCap className="w-5 h-5" />,
      title: 'Add Course',
      description: 'Create a new course offering',
      link: '/admin/dashboard/courses',
      bgColor: 'bg-blue-600'
    },
    {
      icon: <FaHandshake className="w-5 h-5" />,
      title: 'Add Service',
      description: 'Create a new service',
      link: '/admin/dashboard/services',
      bgColor: 'bg-green-600'
    },
    {
      icon: <FaCog className="w-5 h-5" />,
      title: 'Edit Hero',
      description: 'Update hero section',
      link: '/admin/dashboard/hero',
      bgColor: 'bg-purple-600'
    },
    {
      icon: <FaGlobeAmericas className="w-5 h-5" />,
      title: 'Countries',
      description: 'Manage country offerings',
      link: '/admin/dashboard/countries',
      bgColor: 'bg-red-600'
    }
  ];

  // Format date for dashboard
  const formatDate = (date) => {
    const options = { weekday: 'long', year: 'numeric', month: 'long', day: 'numeric' };
    return date.toLocaleDateString('en-US', options);
  };

  // Function to open website in new tab
  const openWebsite = (path = '') => {
    window.open(`/${path}`, '_blank');
  };

  return (
    <div>
      {/* Welcome Section */}
      <div className="bg-white rounded-lg shadow-lg p-6 mb-8">
        <div className="flex flex-col md:flex-row md:items-center md:justify-between">
          <div>
            <h2 className="text-2xl font-bold text-gray-900">Welcome back, Admin</h2>
            <p className="text-gray-600 mt-1">{formatDate(currentTime)}</p>
          </div>
          <div className="mt-4 md:mt-0 flex space-x-2">
            <button 
              onClick={() => openWebsite()} 
              className="flex items-center px-4 py-2 bg-navy text-white rounded-md hover:bg-navy-dark transition-colors"
            >
              <FaExternalLinkAlt className="mr-2" /> View Website
            </button>
          </div>
        </div>
      </div>

      {/* Stats Grid */}
      <h3 className="text-xl font-semibold text-gray-900 mb-4">Key Metrics</h3>
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6 mb-8">
        {statCards.map((stat, index) => (
          <StatCard key={index} {...stat} />
        ))}
      </div>

      <div className="grid grid-cols-1 lg:grid-cols-3 gap-6 mb-8">
        {/* Recent Activity */}
        <div className="lg:col-span-2 bg-white rounded-lg shadow-lg p-6">
          <div className="flex justify-between items-center mb-4">
            <h3 className="text-xl font-semibold text-gray-900">Recent Activity</h3>
            <Link to="#" className="text-navy hover:text-navy-dark text-sm font-medium">View All</Link>
          </div>
          <div className="space-y-4">
            {activities.map(activity => (
              <ActivityItem key={activity.id} {...activity} />
            ))}
          </div>
        </div>

        {/* Quick Actions */}
        <div className="bg-white rounded-lg shadow-lg p-6">
          <h3 className="text-xl font-semibold text-gray-900 mb-4">Quick Actions</h3>
          <div className="grid grid-cols-1 gap-4">
            {quickActions.map((action, index) => (
              <QuickAction key={index} {...action} />
            ))}
          </div>
        </div>
      </div>

      {/* Website Sections */}
      <div className="bg-white rounded-lg shadow-lg p-6 mb-8">
        <h3 className="text-xl font-semibold text-gray-900 mb-4">Website Sections</h3>
        <div className="grid grid-cols-1 md:grid-cols-4 gap-4">
          <button 
            onClick={() => openWebsite('')} 
            className="flex items-center justify-between p-4 bg-gray-50 hover:bg-gray-100 rounded-lg transition-colors duration-200"
          >
            <div className="flex items-center">
              <div className="bg-blue-100 p-2 rounded-full">
                <FaHome className="w-5 h-5 text-blue-600" />
              </div>
              <span className="ml-3 font-medium">Hero</span>
            </div>
            <FaExternalLinkAlt className="text-gray-400" />
          </button>

          <button 
            onClick={() => openWebsite('about')} 
            className="flex items-center justify-between p-4 bg-gray-50 hover:bg-gray-100 rounded-lg transition-colors duration-200"
          >
            <div className="flex items-center">
              <div className="bg-green-100 p-2 rounded-full">
                <FaInfoCircle className="w-5 h-5 text-green-600" />
              </div>
              <span className="ml-3 font-medium">About</span>
            </div>
            <FaExternalLinkAlt className="text-gray-400" />
          </button>

          <button 
            onClick={() => openWebsite('services')} 
            className="flex items-center justify-between p-4 bg-gray-50 hover:bg-gray-100 rounded-lg transition-colors duration-200"
          >
            <div className="flex items-center">
              <div className="bg-purple-100 p-2 rounded-full">
                <FaHandshake className="w-5 h-5 text-purple-600" />
              </div>
              <span className="ml-3 font-medium">Services</span>
            </div>
            <FaExternalLinkAlt className="text-gray-400" />
          </button>

          <button 
            onClick={() => openWebsite('countries')} 
            className="flex items-center justify-between p-4 bg-gray-50 hover:bg-gray-100 rounded-lg transition-colors duration-200"
          >
            <div className="flex items-center">
              <div className="bg-red-100 p-2 rounded-full">
                <FaGlobeAmericas className="w-5 h-5 text-red-600" />
              </div>
              <span className="ml-3 font-medium">Countries</span>
            </div>
            <FaExternalLinkAlt className="text-gray-400" />
          </button>

          <button 
            onClick={() => openWebsite('courses')} 
            className="flex items-center justify-between p-4 bg-gray-50 hover:bg-gray-100 rounded-lg transition-colors duration-200"
          >
            <div className="flex items-center">
              <div className="bg-yellow-100 p-2 rounded-full">
                <FaGraduationCap className="w-5 h-5 text-yellow-600" />
              </div>
              <span className="ml-3 font-medium">Top Courses</span>
            </div>
            <FaExternalLinkAlt className="text-gray-400" />
          </button>

          <button 
            onClick={() => openWebsite('testimonials')} 
            className="flex items-center justify-between p-4 bg-gray-50 hover:bg-gray-100 rounded-lg transition-colors duration-200"
          >
            <div className="flex items-center">
              <div className="bg-indigo-100 p-2 rounded-full">
                <FaComments className="w-5 h-5 text-indigo-600" />
              </div>
              <span className="ml-3 font-medium">Testimonials</span>
            </div>
            <FaExternalLinkAlt className="text-gray-400" />
          </button>

          <button 
            onClick={() => openWebsite('cat')} 
            className="flex items-center justify-between p-4 bg-gray-50 hover:bg-gray-100 rounded-lg transition-colors duration-200"
          >
            <div className="flex items-center">
              <div className="bg-orange-100 p-2 rounded-full">
                <FaChartLine className="w-5 h-5 text-orange-600" />
              </div>
              <span className="ml-3 font-medium">CAT</span>
            </div>
            <FaExternalLinkAlt className="text-gray-400" />
          </button>

          <button 
            onClick={() => openWebsite('')} 
